fooDisk=test.img

echo "Creating a fresh test.img using ./mktest"
rm -f $fooDisk
./mktest $fooDisk

#if foo.img doesn't exist, echo Unable to access
for f in ./homework $fooDisk; do
  if [ ! -f $f ] ; then
      echo "Unable to access: $f. Create a test.img using ./mktest test.img and try again."
      exit
  fi
done

